import './index.css';
import * as data from "./Srdata";

function Calapp(){
    return (
    <>
        <div className="header">
        <ass.default/>
        <h1>add {cal.default(40,10)}</h1>
        <h1>sub {cal.sub(40,10)}</h1>
        <h1>mul {cal.mul(40,10)}</h1>
        <h1>div {cal.div(10,3)}</h1>
        </div>
    </>
    );  
}
// ---------------------------------------------------------------------------------
function ncard(val){
    return (
        <ass.Card
                key = {val.id}
                imgsrc = {val.imgsrc}
                title = {val.title}
                link = {val.link}
                catorg = {val.catorg}
